import { makeStyles } from "@material-ui/styles";

export const useStyles = makeStyles(theme => ({
  root: {
    height: 250,
    width: '100%',
    border:  '1px solid black',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'stretch'
  },
  icon: {
    color: '#00FFFF'
  },
  grid: {
    border:  '1px solid black',
  },
  container: {
    position: "relative"
  },
  suggestionsContainerOpen: {
    position: "absolute",
    zIndex: 1,
    // marginTop: theme.spacing(1),
    left: 0,
    right: 0
  },
  suggestion: {
    display: "block"
  },
  suggestionsList: {
    margin: 0,
    padding: 0,
    listStyleType: "none"
  },
  divider: {
    // height: theme.spacing(2)
  }
}))
